import './Schedule.css'

const Schedule = () => {
    
    return (
        <div className='schedule'>
            {
                (() => {
                    let divs = []
                    for (let i = 0; i<15; i++)
                    {
                        for (let j = 0; j<8; j++) {
                            if (i <= 1 || j === 0)
                            {
                                divs.push(<div className='cell ext'></div>)
                            }
                            else {
                            divs.push(<div className='cell' id={(i-2)+'-'+(j-1)}></div>)
                            }
                        }
                    }
                    return divs
                })()
            }
        </div>
    )



}

export default Schedule
